import React from 'react';

const elements = [
    {
      id: '1',
      type: 'input',
      data: { label: 'Input node' },
      position: { x: 100, y: 5 },
    },
    {
      id: '2',
      type: 'default',
      data: { label: 'Default node' },
      position: { x: 100, y: 100 },
    },
    {
      id: '3',
      type: 'output',
      data: { label: 'Output node' },
      position: { x: 100, y: 200 },
    },
  ];

  export default elements;
